import Head from "next/head";
import Container from "../components/Container";


const About = () => {
    return (  
    <div>
        <Container>
        <Head>
            <title>Next.js project - About</title>
        </Head>
        <h1>About</h1>
        <p>Duis minim culpa magna eu sit dolor aliquip nisi elit eu irure velit occaecat reprehenderit. Minim ad mollit enim non labore non Lorem minim dolore Lorem eiusmod. Eiusmod laborum laborum veniam id non duis labore.</p>
        </Container>
    </div>
    )
    
}

export default About;
